// Sidebar.js 
import React from 'react';
import './Sidebar.css';

const Sidebar = () => {
    return (
        <div className="sidebar">
            <div className="search-section">
                <h3>Buscar instrumento...</h3>
                <input type="text" placeholder="Buscar instrumento..." className="search-input" />
                <button className="andean-button">Buscar</button>
            </div>
            <div className="filters-section">
                <h3>Filtrar por tipo:</h3>
                <div className="filter-options">
                    <button className="filter-button">Percusión</button>
                    <button className="filter-button">Instrumentos Andinos</button>
                    <button className="filter-button">Viento</button>
                    <button className="filter-button">Cuerda</button>
                    <button className="filter-button">Percusión</button>
                </div>
                <h3>Técnicas de ML</h3>
                <div className="filter-options">
                    <button className="filter-button">Clasificación</button>
                    <button className="filter-button">Identificación</button>
                </div>
            </div>
        </div>
    );
};

export default Sidebar;
